  [],\n\t\"revision_timestamp\": \"2016-07-27T22:52:33.094334\",\n\t\"name\": \"ravalli-national-wildlife-refuge-annual-narrative-report-calendar-year-1977\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ravalli
  National Wildlife Refuge outlines Refuge accomplishments during the 1977 calendar
  year. The report begins by summarizing the weather conditions and water conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, predators, rodents, raptors, fish, and reptiles- is also covered.
  The Refuge development and maintenance section discusses physical developments.
  Resource management is outlined; topics include grazing. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, hunting, and violations.\",\n\t\"license_title\":
